// src/config.ts
var DEFAULT_NODE_REGISTRY_ADDRESS = "0x49b3A52Db857BC3D16725b0Ec16f416cb341916b";
var DEFAULT_CONTENT_REGISTRY_ADDRESS = "0x183D99Ed54B29Bb10A5FB3AE101007d18f507202";
var DEFAULT_NETWORK = "baseSepolia";
var DEFAULT_CHAIN_URL = "https://summer-boldest-borough.base-sepolia.quiknode.pro/ee822abdf436718f3e9d93b1279a9898600e907f";
var DEFAULT_IPFS_HOST = "http://node:5001/api/v0";
var config_default = z.preprocess(() => {
  const env = import_dotenv_flow.config({ silent: true });
  return {
    ...process.env,
    ...env.parsed
  };
}, z.object({
  PRIVATE_KEY: z.string().transform((val) => {
    const hexValue = val.startsWith("0x") ? val : `0x${val}`;
    return hexValue;
  }),
  NODE_REGISTRY_CONTRACT_ADDRESS: z.string().refine(isAddress).default(DEFAULT_NODE_REGISTRY_ADDRESS),
  CONTENT_REGISTRY_CONTRACT_ADDRESS: z.string().refine(isAddress).default(DEFAULT_CONTENT_REGISTRY_ADDRESS),
  NETWORK: z.enum(["localhost", "base", "baseSepolia"]).default(DEFAULT_NETWORK),
  CHAIN_URL: z.string().url().default(DEFAULT_CHAIN_URL),
  IPFS_HOST: z.string().url().default(DEFAULT_IPFS_HOST)
})).parse(process.env);

// scripts/register-node.ts
var { PEER_ID, STORAGE: STORAGE_STRING } = process.env;
if (!PEER_ID || !STORAGE_STRING) {
  throw new Error("Missing PEER_ID or STORAGE environment variables");
}
var STORAGE = BigInt(STORAGE_STRING);
if (!Object.keys(exports_chains).includes(config_default.NETWORK)) {
  throw new Error("Invalid network");
}
function addHexPrefix(hex) {
  return hex.startsWith("0x") ? hex : `0x${hex}`;
}
var account = privateKeyToAccount(addHexPrefix(config_default.PRIVATE_KEY));
var contract = new NodeRegistryContract({
  account,
  chain: exports_chains[config_default.NETWORK],
  contractAddress: config_default.NODE_REGISTRY_CONTRACT_ADDRESS
});
await contract.registerNode(PEER_ID, STORAGE);
